import React, { PureComponent } from 'react'

class Pin extends PureComponent {

  constructor(props){
    super(props)
  }

  render() {
    return (
      <div className="pin"
        onClick={this.displayInfo}
        style={{
          backgroundColor: props.info.color,
          top: `${props.info.location[1]}px`,
          left: `${props.info.location[0]}px`
        }}>
        <label></label>
      </div>
    )
  }

}

export default Pin;
